import './App.css'
import React from 'react'

import { Routes, Route } from 'react-router-dom'

import HomeScreen from './pages/home'


export default function App() {
  return (
    <>
      <Routes>
        <Route exact element = {<HomeScreen/>} path ="/"/>

      </Routes>
      </>
  )
}
